import React from "react";
import SubTop2 from "Components/SubTop2";
import styled from "styled-components";

const Container = styled.div`
    width: 80vw;
    display: grid;
    grid-template-columns: 1.5fr 5fr;
    margin: auto;
`;
const ContainerLeft = styled.div`
    background: #f3f3f3;
    border-bottom: 1px solid #deddde;
    border-right: 1px solid #deddde;
    display: flex;
    align-items: center;
    padding-left: 20px;
    height: 70px;
`;
const ContainerRight = styled.div`
    border-bottom: 1px solid #deddde;
`;
const Title = styled.div``;
const Input = styled.input`
    height: 30px;
    width: 100px;
`;
const Require = styled.div`
    font-size: 12px;
    color: #2a72e6;
    margin-left: 5px;
`;

const RegisterPresenter = ({ subTopData }) => {
    const formArr = [
        { type: "아이디", placeholder: "User ID", name: "username" },
        { type: "비밀번호", placeholder: "Password", name: "password" },
        {
            type: "비밀번호 확인",
            placeholder: "Password (Re-type)",
            name: "username2",
        },
        { type: "이름", placeholder: "User name", name: "name" },
        { type: "이메일 주소", placeholder: "Email Address", name: "email" },
        {
            type: "휴대폰 번호",
            placeholder: "010-0000-0000",
            name: "phonenumber",
        },
        { type: "생년월일", placeholder: "Click Here", name: "birthday" },
        { type: "성별", placeholder: "남성 / 여성", name: "" },
        {
            type: "구분",
            placeholder: "학생 / 학부모 / 교사 중 해당되는 항목을 적어주세요",
            name: "",
        },
        { type: "보호자명", placeholder: "보호자명을 입력해주세요", name: "" },
    ];

    return (
        <>
            <SubTop2 subTopData={subTopData} />
            {formArr.map((item, index) => (
                <Container key={index}>
                    <ContainerLeft>
                        <Title>{item.type}</Title>
                        <Require>(필수입력)</Require>
                    </ContainerLeft>
                    <ContainerRight>
                        <Input placeholder={item.placeholder} />
                    </ContainerRight>
                </Container>
            ))}
        </>
    );
};
export default RegisterPresenter;
